import React,{useState, useEffect} from 'react'
import PredictComponent from './components/PredictComponent';

function App() {

  const [data, setData] = useState()


  useEffect(() => {
    fetch("/home").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  },[])

  return (
    <div>
      {(typeof data.res === 'undefined') ? (
        <p>cargando...</p>
      ) : (
        data.res.map((res, i) => (
          <p key={i}>{res}</p>
        ))
      )}

    </div>
  )
}

export default App
